import React from 'react';
import styles from './post.module.css';

const Post = (props) => {
    
    let postsData = [
        { id: 1, name: 'Anar' },
        { id: 2, name: 'Vova' },
        { id: 3, name: 'Danya' },
    ]

    
    return <div className={styles.blockPost}>
        <p className={styles.name}>{props.name}</p>
        <p className={styles.text}>{props.text}</p>
    </div>
}

export default Post;
